	public void getdoctor_Item() throws Exception {
		Node Items = document.selectSingleNode("/Report_Result/Report_Info/result_info");// 获取根节点
		//System.out.println("当前节点的内容：" + Items.asXML());// 当前节点名称
		List<Element> listElement = Items.getParent().elements();// 所有一级子节点的list
		getNodes_doctor_coms(listElement);
	}

	@SuppressWarnings("unchecked")
	private void getNodes_doctor_coms(List<Element> listElement)  throws Exception {	
		Map<String, RetLisChargeItemJY> rtlischarge_map=new HashMap<String, RetLisChargeItemJY>();// 收费项目
		for(Element e:listElement){
			String componentxml=e.asXML();
//			System.out.println(componentxml);
			if(componentxml.indexOf("<result_info>")==0){
				try{
//					System.out.println("当前节点名称：" + e.getName());// 当前节点名称
//					System.out.println("当前节点的内容：" + e.asXML());// 当前节点名称
					InputStream isitem = new ByteArrayInputStream(e.asXML().getBytes("utf-8"));
					SAXReader saxitem = new SAXReader();// 创建一个SAXReader对象
					Document documentItem = saxitem.read(isitem);// 获取document对象,如果文档无节点，则会抛出Exception提前结束
					String  Items_code = documentItem.selectSingleNode("/result_info/lis_combine_code").getText();
					RetLisChargeItemJY  retlisch = rtlischarge_map.get(Items_code);
					if(retlisch == null) {
						retlisch = new RetLisChargeItemJY();
						retlisch.setChargingItem_num(Items_code);
						rtlischarge_map.put(Items_code, retlisch);
					}
					List<RetLisItemJY> listRetLisItem = retlisch.getListRetLisItem();
					RetLisItemJY item = new RetLisItemJY();
					item.setItem_id(documentItem.selectSingleNode("/result_info/lis_item_code").getText());
					item.setValues(documentItem.selectSingleNode("/result_info/result").getText());
					item.setValues_dw(documentItem.selectSingleNode("/result_info/result_unit").getText());
					item.setValue_fw(documentItem.selectSingleNode("/result_info/result_reference").getText());
					item.setValue_ycbz(documentItem.selectSingleNode("/result_info/result_flag").getText());
					listRetLisItem.add(item);
				}catch(Exception ex){
					ex.printStackTrace();
				}
			}
		}
		this.rc.setRtlischarge_map(rtlischarge_map);
	}
	
	private void getNodes_doctor_Item() throws Exception {		
		List<RetPacsItem> rpi=new ArrayList<RetPacsItem>();
		RetPacsItem reti=new RetPacsItem();
//			reti.setChargingItem_num(Items_code);
		String  result = document.selectSingleNode("/Report_Result/Report_Info/result_info/result").getText();// 获取根节点
			reti.setChargingItem_ms(result);
			reti.setChargingItem_jl(result);
			reti.setImagetype("jpg");
			String  Items_base = document.selectSingleNode("/Report_Result/Report_Info/report_pic/pic_content").getText();// 获取根节点
			reti.setBase64_bg(Items_base);
			rpi.add(reti);
		this.rc.setList(rpi);
	}

